import React from "react";
import Page from "../components/Page";

const NotFound = () => {
  return (
    <Page title="Not Found">
      <p className="fs-4 fw-normal lead">
        Sorry, we couldn't find what you were looking for.
      </p>
    </Page>
  );
};

export default NotFound;
